(1, 'Burton Polartec® One World Fleece Long Sleeve T-Shirt', '<div class=\"detail-description-compartment\" style=\"box-sizing: inherit; position: relative; width: 714.4px; min-height: 1px; padding-left: 10px; padding-right: 10px; flex: 0 0 100%; max-width: 100%; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; font-size: 16px; background-color: #ffffff;\">\r\n<h3 class=\"product-short-description\" style=\"box-sizing: inherit; margin-top: 0.75rem; margin-bottom: 1.5rem; font-size: 1.125rem; line-height: 1.375rem;\">In celebration of our film One World, Burton and Polartec&reg; have teamed up with MTN DEW&reg; to produce this collection exclusively with Polartec&reg; fabric made from recycled plastic bottles.</h3>\r\n<div class=\"product-long-description\" style=\"box-sizing: inherit;\">\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem;\">Pure and simple. The Burton One World Long Sleeve T-Shirt shares your sideways-sliding view of the world when you can\'t be on the mountain. Super-soft organic cotton sets the bar for comfort.</p>\r\n</div>\r\n<div class=\"spectrum-row\" style=\"box-sizing: inherit; display: flex; border-bottom: 1px solid #e5e5e5; justify-content: space-between; margin-top: 1.5rem; padding-top: 1.5rem; border-top: 1px solid #e5e5e5;\">&nbsp;</div>\r\n</div>\r\n<div class=\"detail-features-compartment\" style=\"box-sizing: inherit; position: relative; width: 714.4px; min-height: 1px; padding-left: 10px; padding-right: 10px; flex: 0 0 100%; max-width: 100%; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; font-size: 16px; background-color: #ffffff;\">\r\n<div class=\"feature-details-container\" style=\"box-sizing: inherit; font-size: 0.75rem; line-height: 1.125rem; padding-left: 1rem; margin-top: 2.25rem;\">\r\n<div id=\"feature-id-H21-227861_X01\" class=\"feature-detail\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><span class=\"feature-info\" style=\"box-sizing: inherit;\">Polartec&reg; Power Grid&trade; is a patented grid-construction knit that strengthens performance efficiency by increasing warmth and breathability, while also reducing fabric mass and weight. These geometric patterns improve compressibility and wicking and add technical style. By reinventing thermal warmth possibilities, Power Grid&trade; is a minimalist design that maximizes fabric performance.</span></div>\r\n<div id=\"feature-id-H21-227861_14828\" class=\"feature-detail\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><span class=\"feature-info\" style=\"box-sizing: inherit;\">Regular fit is just right: Not too tight or too baggy</span></div>\r\n<div id=\"feature-id-H21-227861_14653\" class=\"feature-detail\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><span class=\"feature-info\" style=\"box-sizing: inherit;\">Ribbed collar and cuffs</span></div>\r\n<div id=\"feature-id-H21-227861_10587\" class=\"feature-detail\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><span class=\"feature-info\" style=\"box-sizing: inherit;\">Pre-shrunk</span></div>\r\n<div id=\"feature-id-H21-227861_SRC1\" class=\"feature-detail\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><span class=\"feature-info\" style=\"box-sizing: inherit;\">Imported</span></div>\r\n<div id=\"feature-id-H21-227861_WAR1 glossary-id-805\" class=\"feature-detail brtn-popover theme-glossary theme-mobile-true\" style=\"box-sizing: inherit; position: relative; margin-bottom: 1.5rem;\"><a class=\"feature-info-link \" style=\"box-sizing: inherit; background-color: transparent; text-decoration-line: none; color: #3d7c7d; transition: color 0.1s ease 0s; border-bottom: none; padding: 0px; display: block; z-index: 1; position: relative;\" href=\"https://www.burton.com/us/en/p/one-world-fleece-long-sleeve-t-shirt/H21-227861.html?cgid=mens-new-arrivals\">Lifetime Warranty</a></div>\r\n</div>\r\n</div>', 0, 1, 0, 0, '10000', NULL, '2.30', 'unisex', '{\"title\": \"Burton Polartec® One World Fleece Long Sleeve T-Shirt\", \"description\": \"Burton Polartec® One World Fleece Long Sleeve T-Shirt\"}', 1, 1, '2021-01-05 09:31:39', '2021-01-05 10:47:25', NULL),
(2, 'Men\'s Burton Lightweight X Base Layer Crewneck', '<h2 class=\"detail-feature-heading\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-weight: 400; font-size: 1rem; line-height: 1.5rem; text-transform: uppercase; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">MEN\'S BURTON LIGHTWEIGHT X BASE LAYER CREWNECK</h2>\r\n<h3 class=\"product-short-description\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-size: 1.5rem; line-height: 1.75rem; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">More than just a base layer, it\'s a four-season shirt with breathability for staying on the move.</h3>\r\n<div class=\"product-long-description\" style=\"box-sizing: inherit; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; font-size: 16px; background-color: #ffffff;\">\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem;\">Winter layer, for sure. Spring breathability, absolutely. Quick-drying for summer fun, you bet. The men\'s Burton Lightweight X Base Layer Crewneck brings breathability and comfy stretch to adventures big and small. It\'s the base-layer shirt you can wear to hit the hill, go for a hike, or just wear under your hoodie \'cause it feels good.</p>\r\n</div>', 1, 1, 0, 0, '29350', '23000', '3.10', 'male', '{\"title\": \"\", \"description\": \"\"}', 1, 1, '2021-01-05 10:43:31', '2021-01-05 10:43:31', NULL),
(3, 'Women\'s Burton GORE-TEX Mitten', '<h2 class=\"detail-feature-heading\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-weight: 400; font-size: 1rem; line-height: 1.5rem; text-transform: uppercase; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">WOMEN\'S BURTON GORE-TEX MITTEN</h2>\r\n<h3 class=\"product-short-description\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-size: 1.5rem; line-height: 1.75rem; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">A trusty technical GORE-TEX glove with removable liner provides two-in-one versatility and warmth all winter long.</h3>\r\n<div class=\"product-long-description\" style=\"box-sizing: inherit; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; font-size: 16px; background-color: #ffffff;\">\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem;\">The life of a mitten is not easy. More than any other part of your riding kit, mittens have the most contact with the elements. With that in mind, the Burton team chooses the women\'s Burton GORE-TEX Mitten. DRYRIDE 2L fabric, a GUARANTEED TO KEEP YOU DRY&reg; GORE-TEX membrane, Gore Warm technology and Thermacore insulation protect you in the worst weather conditions. The Screen Grab&reg; synthetic leather palm gives you full coverage touchscreen control using tech that will never fray, wear out, or wash off. A removable four-way stretch fleece liner dries quickly and gives you options for any weather. Wear just the liner for mild weather laps, just the shell in sloppy spring conditions, or combine the two for total midwinter riding warmth and comfort.</p>\r\n<p>&nbsp;</p>\r\n</div>', 0, 1, 1, 0, '53000', NULL, '0.30', 'female', '{\"title\": \"Women\'s Burton GORE-TEX Mitten\", \"description\": \"Women\'s Burton GORE-TEX Mitten\"}', 1, 1, '2021-01-05 10:52:51', '2021-01-05 10:52:51', NULL),
(4, 'Kids\' Burton Step On® Re:Flex Snowboard Binding', '<div class=\"container\" style=\"box-sizing: inherit; margin-right: auto; margin-left: auto; padding-left: 2.75rem; padding-right: 2.75rem; max-width: calc(1376px + 4rem + 1.5rem);\">\r\n<section class=\"product-details-video__container\" style=\"box-sizing: inherit; display: flex; text-align: center; padding: 2rem 0px;\">\r\n<div class=\"product-details-video__row\" style=\"box-sizing: inherit; display: flex; flex-wrap: wrap; margin-left: -0.75rem; margin-right: -0.75rem;\">\r\n<div class=\"product-details-video__col product-details-video__col--description\" style=\"box-sizing: inherit; position: relative; width: 933.325px; min-height: 1px; padding-left: 14px; padding-right: 14px; flex: 0 0 66.6667%; max-width: 66.6667%;\">\r\n<div class=\"product-description__row\" style=\"box-sizing: inherit; display: flex; flex-wrap: wrap; margin-left: -0.75rem; margin-right: -0.75rem; align-items: center; justify-content: center; text-align: left;\">\r\n<div class=\"product-description__col\" style=\"box-sizing: inherit; position: relative; width: 774.425px; min-height: 1px; padding-left: 14px; padding-right: 14px; flex: 0 0 83.3333%; max-width: 83.3333%;\">\r\n<h2 class=\"product-description__short-description\" style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-size: 1.5rem; line-height: 1.75rem; padding-bottom: 1.5rem;\">The convenience of Step On&reg; for riders with little feet and big dreams.</h2>\r\n<div class=\"product-description__long-description\" style=\"box-sizing: inherit; padding-bottom: 2.25rem;\">\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 1rem;\">Give your young rider the power of independence with the kids\' Burton Step On Re:Flex Snowboard Binding. Like the name says, it\'s a step-on-and-ride scenario. Featuring the same design as the adult model, the Step On binding means little hands don\'t need to fumble with straps. Zero lean hi-backs keep it playful and relaxed to help young riders progress.</p>\r\n</div>\r\n<div class=\"spectrum-container__row\" style=\"box-sizing: inherit; display: flex; flex-wrap: wrap; margin-left: -0.75rem; margin-right: -0.75rem;\">\r\n<div class=\"spectrum-container__col\" style=\"box-sizing: inherit; position: relative; width: 577.812px; min-height: 1px; padding-left: 14px; padding-right: 14px; flex: 0 0 75%; max-width: 75%;\">\r\n<h3 class=\"spectrum-topic text-s1-standard-bold\" style=\"box-sizing: inherit; margin-top: 2.25rem; margin-bottom: 0px; font-size: 1rem; line-height: 1.5rem;\">Response / Personality:</h3>\r\n<div style=\"box-sizing: inherit;\" data-v-65cf05ba=\"\">\r\n<div class=\"spectrum personality\" style=\"box-sizing: inherit; align-items: flex-end; border-bottom: 1px solid #4796a8; display: flex; margin-bottom: 0.25rem;\" data-v-65cf05ba=\"\">&nbsp;</div>\r\n<div class=\"spectrum-legend\" style=\"box-sizing: inherit; display: flex; padding: 0.25rem 0.5rem;\" tabindex=\"-1\" data-v-65cf05ba=\"\"><span class=\"text-b3-standard\" style=\"box-sizing: inherit; font-size: 0.75rem; line-height: 1.125rem; flex: 1 1 0%; text-align: center; display: inline-block; padding: 0px 0.375rem;\" data-v-65cf05ba=\"\">Soft</span><span class=\"text-b3-standard\" style=\"box-sizing: inherit; font-size: 0.75rem; line-height: 1.125rem; flex: 1 1 0%; text-align: center; display: inline-block; padding: 0px 0.375rem;\" data-v-65cf05ba=\"\">Medium</span><span class=\"text-b3-standard\" style=\"box-sizing: inherit; font-size: 0.75rem; line-height: 1.125rem; flex: 1 1 0%; text-align: center; display: inline-block; padding: 0px 0.375rem;\" data-v-65cf05ba=\"\">Stiff</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<aside class=\"product-details-video__col product-details-video__col--video\" style=\"box-sizing: inherit; position: relative; width: 466.663px; min-height: 1px; padding-left: 14px; padding-right: 14px; flex: 0 0 33.3333%; max-width: 33.3333%; align-items: center; justify-content: center;\">\r\n<div class=\"clinic-video\" style=\"box-sizing: inherit; margin-top: 0px;\" data-v-9e437664=\"\"><button class=\"clinic-video__button text-only-btn\" style=\"box-sizing: inherit; font: inherit; margin: 0px auto; overflow: visible; cursor: pointer; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; color: #4e4c4b; width: 250px; border: 0px initial initial;\" type=\"button\" data-v-9e437664=\"\"><picture class=\"clinic-video__image\" style=\"box-sizing: inherit; display: flex; border-radius: 100%; overflow: hidden; margin: auto; width: 250px; position: relative;\" data-v-9e437664=\"\"><img style=\"box-sizing: inherit; border: 0px; vertical-align: middle; object-fit: cover; max-width: 100%; width: 250px; height: 250px; position: absolute; inset: 0px;\" src=\"https://www.burton.com/static/product/tech_images/FPO.clinic.video.png?impolicy=bgwhite&amp;imwidth=452\" alt=\"Clinic video image\" data-v-9e437664=\"\" /></picture><span class=\"clinic-video__text text-a1-standard-underline\" style=\"box-sizing: inherit; font-size: 0.875rem; line-height: 1.3125rem; text-decoration-line: underline; margin-top: 1.5rem; display: block;\" data-v-9e437664=\"\">Watch the clinic video.</span></button></div>\r\n</aside>\r\n</div>\r\n</section>\r\n</div>\r\n<section class=\"product-features\" style=\"box-sizing: inherit;\">\r\n<div class=\"product-features__accordion\" style=\"box-sizing: inherit;\">\r\n<div class=\"product-features__accordion__header\" style=\"box-sizing: inherit; cursor: pointer; margin-top: 0.75rem; pointer-events: none; color: #4e4c4b; font-family: \'Helvetica Now\', Helvetica, Arial, sans-serif; font-size: 16px; background-color: #ffffff;\" tabindex=\"0\" role=\"button\" aria-pressed=\"true\">\r\n<div class=\"product-features__banner product-features__banner--with-background\" styl